Provision of 2no. temporary 4 classroom primary schools in conjunction with the Department of Education and Skills as follows:
Stage 1:
Provision of 2 no. 4 classroom temporary primary schools on site located immediately to the east of Firhouse Community Centre between Killininny Road and Ballycullen Drive, Firhouse, Dublin 24 for a temporary period up to 4 years;
Provision of permanent public car parking area for a minimum of 15 no. cars off Killininny Road which will provide a drop-off area for the school and public car park outside school hours;
New road markings along Killininny Road to provide access/egress to new car park;
Provision of drop-off area for a minimum of 15no. cars and staff car parking to north of temporary schools to be accessed off Ballycullen Drive;
Realignment of existing footpath between Ballycullen Drive / Killininny Road to provide new pedestrian/cyclist link between Firhouse Community Centre and proposed temporary schools;
Existing pedestrian gate at Killininny Road to be retained.
Stage 2:
Construction of public playground following removal of 2no. 4 classroom schools after a temporary period of four years.

Plans and particulars of the proposed scheme will be available for inspection or purchase at a fee not exceeding the reasonable cost of making a copy from Thursday 30th May 2013 to Friday 12th July 2013 at the following locations:
South Dublin County Council, County Hall, Tallaght, Dublin 24 (between the hours of 9:00am - 5:00pm Monday to Thursday and 9.00am - 4.30pm on Friday);   County Library, Tallaght, Dublin 24 (between the hours of 9:45am - 8:00pm Monday to Thursday and 9:45am - 4:30pm Friday and Saturday)- INSPECTION ONLY;   Firhouse Community Centre, Ballycullen Drive, Firhouse, Dublin 24 (between the hours of 8:30am - 10:00pm Monday to Friday and 10.00am - 10.000pm Saturday and Sunday) - INSPECTION ONLY.
