Construction of Walking and Cycling Route at the following location: • A shared walking and cycling route from Griffeen Road to Ballyowen Road (Outer Ring Road), (R136) at Ballyowen, Lucan incorporating walking and cycling links from Castle Riada and Moyglas housing estates.  The following is proposed:   • A pedestrian and cycle access point onto Ballyowen Road (Outer Ring Road) (R136);
• Upgrading of the existing access and cycle facilities from Griffeen Road to the route;   • A new 4m wide shared walking and cycling route along the line of the Esker linking Griffeen Road and Ballyowen Road (Outer Ring Road) (R136) including access for the less mobile;   • A pedestrian and cycle access from Moyglas housing estate to Ballyowen Road (Outer Ring Road) (R136);   • Walking and cycling links from Castle Riada and Moyglas housing estates to the new route;   • New landscape design interventions;   • Provision of CCTV and public lighting for the route and • All ancillary works.   The proposal has undergone Appropriate Assessment Screening under the Habitats Directive (92/43/EEC).   Plans and particulars of the proposed scheme will be available for inspection or purchase at a fee not exceeding the reasonable cost of making a copy from Thursday 6th of September 2012 to Thursday 18th October 2012 at the following locations:   • South Dublin County Council Offices, County Hall, Tallaght, Dublin 24 between the hours of 9:00 am – 5.00pm
Monday to Thursday and 9.00am - 4.30pm on Friday (Inspection and purchase);   • Clondalkin Civic Centre, Ninth Lock Road, Clondalkin, Dublin 22 between the hours of 9:00 am – 5.00pm Monday to Thursday and 9.00am - 4.30pm on Friday (Inspection only);   • Lucan Library, Superquinn Shopping Centre, Newcastle Road, Lucan, Co. Dublin between the hours of 9.45 am to 8 pm Mon to Thurs. 9.45am to 4.30pm Fri to Sat. Closed Saturdays and Mondays of Bank Holiday Weekends (Inspection only).  • The plans and particulars can be viewed on South Dublin County Council’s website – www.sdcc.ie.  Written submissions or observations with respect to the proposed development, dealing with the proper planning and sustainable development of the area in which the development would be situated may be made in writing before 4.30pm on Friday 2nd November 2012 to:  Tony Shanahan, Administrative Officer, Economic, Development and Transport Planning Department, South Dublin County Council, County Hall, Tallaght, Dublin 24. Email: travelsmart@sdublincoco.ie

Material alteration and extension of office of Tallaght Welfare Society including moving main entrance/reception from no. 1 to no.2, the permanent combination of no’s 1 & 2 by removal of individual stairs, demolition of 8sqm kitchen extension and addition of a 67sqm two storey extension, addition of 2 no. windows to existing extension, and the provision of a ramp to front of no 2 for equal access.  
Drawings of the proposed extension will be on public display at the Headquarters of South Dublin County Council, County Hall, Tallaght, Dublin 24, on http://www.sdcc.ie/ and at Tallaght Welfare Society Offices, 1 – 2 Main Street, Tallaght, during normal working hours in the period from 27th August 2009 to 7th October 2009.   Submissions or observations with respect to this matter dealing with the proper planning and sustainable development of the area in which the development would be situated may be made in writing to;
The Senior Executive Officer, Development Department, South Dublin County Council, County Hall, Tallaght, Dublin 24.  The latest date for the receipt of submissions or observations is 4.30pm on Thursday 21st October 2009.
